  \"2016-03-17T20:51:59.477491\",\n\t\"name\": \"campaign-expenditures\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains information on expenditures
  made by state-wide, legislative or local candidate committees, state PACs, county
  central committees, state parties, and state and local ballot issue committees.
  Data is available beginning in 2003 for all reports filed electronically, and some
  paper filed reports.  Data is provided through reports submitted by candidate committees,
  state political committees, federal/out-of-state political committees, county central
  committees, ballot issue committees and organizations making contributions or independent
  expenditures.  Quality of the data provided in the dataset is dependent upon the
  accuracy of the data reported electronically.\",\n\t\"license_title\": \"License
